import * as React from 'react';

import Beer from './Beer';

interface Props {}

interface State {
  beers: string[];
};

export default class Counter extends React.Component<Props, State> {
  state: State = {
    beers: ["Maximator", "8.6"]
  };

  render () {
    return (
      <div>
      	<ul>
      		{this.state.beers.map((value) => {
      			return <Beer name={value} />
      		})}
        </ul>
      </div>
    );
  }
}
